import React from 'react';
// import './Joul.css';
import WorkTitle from './WorkTitle/WorkTitle';
import { WorkOne } from './WorkTitle/Data';


function Joul() {

    const isBackgroundWhite = true;
    return (
        <>
        <div className = {isBackgroundWhite ? 'white' : 'green'} />
        <WorkTitle {...WorkOne} />

        </>
    )
}

export default Joul;
